import "./LoginPage.css";

function LoginPage() {
  return (
    <div class="container">
      <div>
        <form>
          <h1>Welcome to <br/> Erasmus App!</h1>
          <input type="text" placeholder="username" />
          <input type="password" placeholder="password" />
          <div className="center">
            <button>login</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
